QueueHandle_t nmeaQueue;
QueueHandle_t consumerQueue;

typedef struct {
    int fixMode;
        char longitude[MAX_POSITION_LENGTH];
        char latitude[MAX_POSITION_LENGTH];
        char altitude[MAX_POSITION_LENGTH];
    char timestamp[10];
} NMEAData;

// GNSS module simulation task
void gnssModuleTask(void* parameter) {
    TickType_t lastWakeTime = xTaskGetTickCount();

    bool isIn3DFixMode = false;  // Track 3D fix mode

    while (1) {
        // Transmit burst of NMEA lines every second
        for (int i = 0; i < sizeof(simulatedData) / sizeof(simulatedData[0]); i++) {
            const char* nmeaLine = simulatedData[i];
            size_t lineLength = strlen(nmeaLine);

            // Send the NMEA line as a message through the message queue
            for (size_t j = 0; j < lineLength; j++) {
                char data = nmeaLine[j];
                xQueueSend(nmeaQueue, &data, portMAX_DELAY);
            }

            // Check if it's the last line of the burst
            if (strstr(nmeaLine, "$GPZDA") != NULL) {
                // Wait for 1 second before transmitting the next burst
                vTaskDelay(pdMS_TO_TICKS(100));
            }
        }

        vTaskDelayUntil(&lastWakeTime, pdMS_TO_TICKS(100));
    }
}

bool verifyChecksum(const char* nmeaLine) {
    // Verify the checksum of the NMEA line
    int checksum = 0;
    size_t i = 1; // Skip the leading '$'
    char c = nmeaLine[i++];
    while (c != '*' && c != '\0') {
        checksum ^= c;
        c = nmeaLine[i++];
    }

    if (c == '*') {
        // Parse the checksum value
        char checksumStr[3];
        checksumStr[0] = nmeaLine[i++];
        checksumStr[1] = nmeaLine[i++];
        checksumStr[2] = '\0';

        // Convert the checksum value from hexadecimal to integer
        int receivedChecksum = strtol(checksumStr, NULL, 16);

        // Compare the received checksum with the calculated checksum
        return checksum == receivedChecksum;
    }

    return false; // Invalid NMEA line without a checksum
}

// NMEA parser task
void nmeaParserTask(void* parameter) {
    char nmeaLine[MAX_NMEA_LINE_LENGTH];
    size_t lineIndex = 0;
    int previousFixMode = 0;
    NMEAData data;

    while (1) {
        // Receive the NMEA line from the message queue
        char receivedData;
        if (xQueueReceive(nmeaQueue, &receivedData, portMAX_DELAY) == pdTRUE) {
            // Skip any text before the first NMEA message
            if (lineIndex == 0 && receivedData != '$') {
                continue;
            }

            // Store the received character in the line buffer
            nmeaLine[lineIndex++] = receivedData;

            // Check if it's the end of the line or the buffer is full
            if (receivedData == '\n' || lineIndex >= MAX_NMEA_LINE_LENGTH) {
                // Process the complete NMEA line
                nmeaLine[lineIndex] = '\0';
                // Verify the checksum of the NMEA message
                if (verifyChecksum(nmeaLine) || 1) {
                // Parse fix mode, position, and time
                if (strstr(nmeaLine, "$GPGSA") != NULL) {
                    // Check if it's entering or leaving 3D fix mode
                    if (strstr(nmeaLine, ",3,") != NULL) {
                        // Entering 3D fix mode
                        if (data.fixMode != 3) {
                            printf("Nmea parser: Entering 3D fix mode\n");
                            data.fixMode = 3;
                            xQueueSend(consumerQueue, &data, 0);
                        }
                    } else {
                        // Leaving 3D fix mode
                        if (data.fixMode != 0) {
                            printf("Nmea parser: Leaving 3D fix mode\n");
                            data.fixMode = 0;
                            xQueueSend(consumerQueue, &data, 0);
                        }
                    }
                } else if (strstr(nmeaLine, "$GPZDA") != NULL) {
                    char* token = strtok(nmeaLine, ",");
                    int tokenIndex = 0;
                    while (token != NULL) {
                        if (tokenIndex == 1) {
                            strncpy(data.timestamp, token, sizeof(data.timestamp));
                        }
                        token = strtok(NULL, ",");
                        tokenIndex++;
                    }
                } else if (strstr(nmeaLine, "$GPGGA") != NULL) {
                    char* token = strtok(nmeaLine, ",");
                    int tokenIndex = 0;
                    while (token != NULL) {
                        if (tokenIndex == 2) {
                            // Longitude
                            strncpy(data.longitude, token, sizeof(data.longitude));
                        } else if (tokenIndex == 3) {
                            // Latitude
                            strncpy(data.latitude, token, sizeof(data.latitude));
                        } else if (tokenIndex == 9) {
                            // Altitude
                            strncpy(data.altitude, token, sizeof(data.altitude));
                        }
                        token = strtok(NULL, ",");
                        tokenIndex++;
                    }
                }

                // Reset the line buffer index
                lineIndex = 0;
             }
            }
        } else {
            // No data received, wait for a short while to avoid busy-waiting
            vTaskDelay(pdMS_TO_TICKS(10));
        }
    }
}


// Consumer task
void consumerTask(void* parameter) {
    NMEAData data;
    bool isIn3DFixMode = false; // Track 3D fix mode

    while (1) {
        // Receive fix mode data from the NMEA parser task
        if (xQueueReceive(consumerQueue, &data, portMAX_DELAY) == pdTRUE) {
            if (data.fixMode == 3 && !isIn3DFixMode) {
                // Entering 3D fix mode
                printf("Consumer task: Entering 3D fix mode\n");
                printf("Consumer task: Time: %s\n", data.timestamp); 
                printf("Position: Longitude=%s, Latitude=%s, Altitude=%s\n", data.longitude, data.latitude, data.altitude);
					 printf("Position: Longitude=%s, Latitude=%s, Altitude=%s\n", data.longitude, data.latitude, data.altitude);                               
                isIn3DFixMode = true;
            } else if (data.fixMode == 0 && isIn3DFixMode) {
                // Leaving 3D fix mode
                printf("Consumer task: Leaving 3D fix mode\n");
                isIn3DFixMode = false;
            }

            // Print position and time when in 3D fix mode
            if (isIn3DFixMode) {
                //printf("Consumer task: Position: %s\n", data.position);

            }
        }
    }
}


int main() {
    // Create the message queues
    nmeaQueue = xQueueCreate(QUEUE_LENGTH, sizeof(char));
    consumerQueue = xQueueCreate(QUEUE_LENGTH, sizeof(NMEAData));

    // Create the GNSS module task
    xTaskCreate(gnssModuleTask, "GNSS Module Task", configMINIMAL_STACK_SIZE, NULL, 1, NULL);

    // Create the NMEA parser task
    xTaskCreate(nmeaParserTask, "NMEA Parser Task", configMINIMAL_STACK_SIZE, NULL, 2, NULL);

    // Create the consumer task
    xTaskCreate(consumerTask, "Consumer Task", configMINIMAL_STACK_SIZE, NULL, 3, NULL);

    // Start the FreeRTOS scheduler
    vTaskStartScheduler();

    // The scheduler should never return, but if it does, handle the error
    while (1) {
        // Handle error
    }

    return 0;
}

